# Middle name of household member is the same as his/her last name

## Verify if middle name and last name are indeed the same. If so, provide valid justification. Otherwise, make necessary corrections.

cv$cv_a_same_last_middle <- section_a_to_f %>%
  filter(a01_middle_name == a01_last_name) %>%
  select_cv(a01_middle_name, a01_last_name)



# Relationship to the household head is missing or not in the value set

## Relationship to the household head should not be blank and should be from 1 to 26 only.

cv$cv_a_rel_to_hh_head <- section_a_to_f %>%
  filter(!(a02_relation_to_hh_head %in% c(1:26))) %>%
  select_cv(a02_relation_to_hh_head)



# Household head but line number is not 1

# The household head should be the first household member.

cv$cv_a_rel_to_hh_head_line_number <- section_a_to_f %>%
  filter(a02_relation_to_hh_head == 1, line_number != 1) %>%
  select_cv(a02_relation_to_hh_head)



# Sex of household member is missing or not in the value set

## Sex of the household member should not be blank and should be 1 or 2 only.

cv$cv_a_sex <- section_a_to_f %>%
  filter(!(a03_sex %in% c(1, 2))) %>%
  select_cv(a03_sex)



# Relationship to household head is for male but sex is inconsistent

## If the relationship to the household head is son (3), stepson (5), son-in-law (7), grandson (9), father (11), father-in-law (13), brother (15), brother-in-law (17), uncle (19) or nephew (21) then sex should be male.

cv$cv_a_rel_to_hh_head_male <- section_a_to_f %>%
  filter(a02_relation_to_hh_head %in% seq(3, 21, 2), a03_sex != 1) %>%
  select_cv(a03_sex, a02_relation_to_hh_head)



# Relationship to household head is for female but sex is inconsistent

## If the relationship to the household head is daughter (4), stepdaughter (6), daughter-in-law (8), granddaughter (10), mother (12), mother-in-law (14), sister (16), sister-in-law (18), aunt (20) or niece (22) then sex should be female.

cv$cv_a_rel_to_hh_head_female <- section_a_to_f %>%
  filter(a02_relation_to_hh_head %in% seq(4, 22, 2), a03_sex != 2) %>%
  select_cv(a03_sex, a02_relation_to_hh_head)



# Birthday is missing (ella, to include not in the value set)

## Birthday should not be blank.

cv$cv_a_birthday <- section_a_to_f %>%
  filter(is.na(a04_birthday)) %>%
  select_cv(a04_birthday)



# Age is missing or not in the value set

## Age should not be blank and should be valid.

cv$cv_a_age <- section_a_to_f %>%
  filter(!(a05_age %in% c(0:130))) %>%
  select_cv(a05_age)



# Incorrect age

## Verify age considering the reference date. Make necessary corrections.

cv$cv_a_incorrect_age <- section_a_to_f %>%
  filter(a05_age != age) %>%
  select_cv(a05_age, age)



# Household head is below 10 years old

## Household head should not be below 10 years old. Verify and provide valid justification if necessary.

cv$cv_a_hh_head_below_10 <- section_a_to_f %>%
  filter(a02_relation_to_hh_head == 1, age < 10) %>%
  select_cv(a02_relation_to_hh_head, age)



# Household head's spouse is below 10 years old

## Household head's spouse should not be below 10 years old. Verify and provide valid justification if necessary.

cv$cv_a_hh_head_spouse_below_10 <- section_a_to_f %>%
  filter(a02_relation_to_hh_head == 2, age < 10) %>%
  select_cv(a02_relation_to_hh_head, age)



# Household head's son-in-law is below 10 years old

## Household head's son-in-law should not be below 10 years old. Verify and provide valid justification if necessary.

cv$cv_a_son_in_law_below_10 <- section_a_to_f %>%
  filter(a02_relation_to_hh_head == 7, age < 10) %>%
  select_cv(a02_relation_to_hh_head, age)



# Household head's daughter-in-law is below 10 years old

## Household head's daughter-in-law should not be below 10 years old. Verify and provide valid justification if necessary.

cv$cv_a_daughter_in_law_below_10 <- section_a_to_f %>%
  filter(a02_relation_to_hh_head == 8, age < 10) %>%
  select_cv(a02_relation_to_hh_head, age)



# Household head's father is below 20 years old

## Household head's father should not be below 20 years old. Verify and provide valid justification if necessary.

cv$cv_a_hh_head_father_below_20 <- section_a_to_f %>%
  filter(a02_relation_to_hh_head == 11, age < 20) %>%
  select_cv(a02_relation_to_hh_head, age)



# Household head's mother is below 20 years old

## Household head's mother should not be below 20 years old. Verify and provide valid justification if necessary.

cv$cv_a_hh_head_mother_below_20 <- section_a_to_f %>%
  filter(a02_relation_to_hh_head == 12, age < 20) %>%
  select_cv(a02_relation_to_hh_head, age)



# Household head's father-in-law is below 20 years old

## Household head's father-in-law should not be below 20 years old. Verify and provide valid justification if necessary.

cv$cv_a_father_in_law_below_20 <- section_a_to_f %>%
  filter(a02_relation_to_hh_head == 13, age < 20) %>%
  select_cv(a02_relation_to_hh_head, age)



# Household head's mother-in-law is below 20 years old

## Household head's mother-in-law should not be below 20 years old. Verify and provide valid justification if necessary.

cv$cv_a_mother_in_law_below_20 <- section_a_to_f %>%
  filter(a02_relation_to_hh_head == 14, age < 20) %>%
  select_cv(a02_relation_to_hh_head, age)



# Domestic helper is below 10 years old

## Domestic helper should not be below 10 years old. Verify and provide valid justification if necessary.

cv$cv_a_domestic_helper_below_10 <- section_a_to_f %>%
  filter(a02_relation_to_hh_head == 25, age < 10) %>%
  select_cv(a02_relation_to_hh_head, age)



# Status of birth registration in LCR is missing or not in the value set

## Status of birth registration in LCR should not be blank and should be 1, 2 or 8 only.

cv$cv_a_birth_registration <- section_a_to_f %>%
  filter(!(a06_lcr_reg_status %in% c(1, 2, 8))) %>%
  select_cv(a06_lcr_reg_status)



# Marital status is missing or not in the value set

## Marital status should not be blank and should be from 1 to 8 only.

cv$cv_a_marital_status <- section_a_to_f %>%
  filter(!(a07_marital_status %in% c(1:8))) %>%
  select_cv(a07_marital_status)



# Spouse of the household head but marital status is not married or common law/live in

## The marital status of the household head's spouse should either be married or common law/live in. Also, ensure that the household head and his/her spouse have the same marital status.


cv$cv_a_spouse_marital_status <- section_a_to_f %>%
  filter(a02_relation_to_hh_head == 2, !(a07_marital_status %in% c(2:3))) %>%
  select_cv(a02_relation_to_hh_head, a07_marital_status)



# Son/daughter-in-law of the household head but marital status is single or unknown

## The marital status of the household head's son-in-law or daughter-in-law should not be single or unknown.

cv$cv_a_son_daughter_in_law_marital_status <- section_a_to_f %>%
  filter(a02_relation_to_hh_head %in% c(7:8), a07_marital_status %in% c(1, 8)) %>%
  select_cv(a02_relation_to_hh_head, a07_marital_status)



# Household member is below 10 years old but not single

## If the household member is below 10 years old, marital status should be single. Otherwise, provide valid justification.

cv$cv_a_not_single_below_10 <- section_a_to_f %>%
  filter(age < 10, a07_marital_status != 1) %>%
  select_cv(age, a07_marital_status)



# With responses in basic literacy and HGC but household member is below five years old

## Household member below five years old should not have responses in basic literacy and HGC.

cv$cv_a_with_literacy_hgc <- section_a_to_f %>%
  filter(age< 5, !is.na(a08_literacy) | !is.na(a09_hgc_level)) %>%
  select_cv(age, a08_literacy, a09_hgc_level)



# Basic literacy is missing or not in the value set for household member five years old and over

## Household member five years old and over should have responses in basic literacy. Answer should be 1 or 2 only.

cv$cv_a_literacy <- section_a_to_f %>%
  filter(age >= 5, !(a08_literacy %in% c(1:2))) %>%
  select_cv(age, a08_literacy)



